      <div className="weekly">
        weekly
        <SurahButton
          onClick={() => {
            navigate("surah", { state: { surah: "Al-Kahf", number: 18 } });
          }}
          surah={surah}
          type={type[i]}
          eName={englishN[i]}
          translation={translation[i]}
          ayahs={ayahs[i]}
          key={i}
          number={number[i]}
        />
      </div>
      <div className="daily">
